class HoverButton(tk.Button):
    def __init__(self, master, **kw):
        tk.Button.__init__(self, master=master, **kw)
        self.default_bg = kw.get('bg', BUTTON_BG)
        self.default_fg = kw.get('fg', BUTTON_FG)
        self.hover_bg = HIGHLIGHT
        self.hover_fg = DARK_BG

        self.bind("<Enter>", self.on_enter)
        self.bind("<Leave>", self.on_leave)

        self.is_animating = False
        self.pulse_job = None

    def on_enter(self, e):
        self.config(bg=self.hover_bg, fg=self.hover_fg)

    def on_leave(self, e):
        self.stop_animation()
        self.config(bg=self.default_bg, fg=self.default_fg)

    def start_animation(self):
        self.is_animating = True
        self.pulse_animation()

    def stop_animation(self):
        self.is_animating = False
        if self.pulse_job is not None:
            self.after_cancel(self.pulse_job)
            self.pulse_job = None
        self.config(bg=self.default_bg, fg=self.default_fg)

    def pulse_animation(self):
        if not self.is_animating:
            return

        current_color = random.choice(COLORS)
        self.config(bg=current_color)

        self.pulse_job = self.after(500, self.pulse_animation)
