def load_saved_notes(notes_text):
    notes_file = os.path.join(os.getcwd(), "toc_notes.txt")

    notes_text.config(state=tk.NORMAL)

    if os.path.exists(notes_file):
        try:
            with open(notes_file, "r", encoding="utf-8") as file:
                content = file.read()
                notes_text.delete(1.0, tk.END)
                notes_text.insert(tk.END, content)
        except Exception as e:
            notes_text.delete(1.0, tk.END)
            notes_text.insert(tk.END, f"Error loading notes: {str(e)}\n\n")
    else:
        notes_text.delete(1.0, tk.END)
        notes_text.insert(tk.END, "Welcome operator.\n\n")
        notes_text.insert(tk.END, "- You should install winget by using WINGET OPERATIONS\n")
        notes_text.insert(tk.END, "- Packages will be automatically installed if supported\n")
        notes_text.insert(tk.END, "- If some applications fail to install, uncheck the 'Run as Administrator' option. Do not escalate the operation\n")
        notes_text.insert(tk.END, "- If you are using nvidia, you should definitely have an automatic driver exe with NVCLEANINSTALL.\n\n")
        notes_text.insert(tk.END, "Have fun!")

    notes_text.config(state=tk.DISABLED)

def animate_loading(log_box, status_label, status_indicator, message="Operation in progress"):
    def update_indicator():
        color = random.choice(["#ffcc00", "#ff9900", "#ff6600"])
        status_indicator.create_oval(2, 2, 13, 13, fill=color, outline="")
        status_label.config(foreground=color, text=message)

    return update_indicator

def install_from_folder(log_box, status_label, status_indicator, button):
    log_message("Entry team moving to position. Starting package deployment operation...", log_box)

    button.start_animation()

    status_update = animate_loading(log_box, status_label, status_indicator, "ENTRY TEAM DEPLOYING")
    status_update()

    if not os.path.exists(installers_folder):
        os.makedirs(installers_folder)
        log_message("Created new deployment zone (installers folder).", log_box)

    installers = [f for f in os.listdir(installers_folder) if f.endswith((".exe", ".msi"))]

    if not installers:
        log_message("Entry team to TOC, deployment zone is empty. No packages found.", log_box)
        status_indicator.create_oval(2, 2, 13, 13, fill="#00ff00", outline="")
        status_label.config(foreground="#00ff00", text="ENTRY TEAM READY")
        button.stop_animation()
        return

    total = len(installers)
    log_message(f"Found {total} packages to deploy. Starting operation.", log_box)

    def installation_thread():
        for i in range(5):
            log_message(f"Preparing tactical systems... {LOADING_SYMBOLS[i*2]}", log_box)
            time.sleep(0.2)

        success_count = 0
        for i, installer in enumerate(installers):
            installer_path = os.path.join(installers_folder, installer)
            log_message(f"Operation progress: {i+1}/{total} [{(i+1)*100//total}%]", log_box)
            if install_package(installer_path, log_box):
                success_count += 1

        time.sleep(0.5)

        if success_count == total:
            message = random.choice(TOC_MESSAGES)
            status_indicator.create_oval(2, 2, 13, 13, fill="#00ff00", outline="")
            status_label.config(foreground="#00ff00", text="MISSION ACCOMPLISHED")
        else:
            message = f"Entry team to TOC, partial success. {success_count}/{total} packages deployed."
            status_indicator.create_oval(2, 2, 13, 13, fill="#ffcc00", outline="")
            status_label.config(foreground="#ffcc00", text="MISSION PARTIAL SUCCESS")

        log_message(message, log_box)
        button.stop_animation()

    thread = threading.Thread(target=installation_thread)
    thread.daemon = True
    thread.start()

def install_package(file_path, log_box):
    try:
        file_name = os.path.basename(file_path)
        log_message(f"Deploying package: {file_name}...", log_box, level="INFO")

        if file_path.lower().endswith('.msi'):
            command = ['msiexec', '/i', file_path, '/qn', '/norestart', '/passive']
            creation_flags = subprocess.CREATE_NO_WINDOW
        elif file_path.lower().endswith('.exe'):
            command = [file_path, '/S', '/SILENT', '/VERYSILENT', '/quiet', '/norestart', '/SUPPRESSMSGBOXES', '/SP-']
            creation_flags = subprocess.CREATE_NO_WINDOW
        else:
            log_message(f"Unsupported file type for {file_name}", log_box, level="ERROR")
            return False

        log_message(f"Executing silent install command for {file_name}...", log_box, level="INFO")
        result = subprocess.run(command, stdout=subprocess.PIPE, stderr=subprocess.PIPE, creationflags=creation_flags, timeout=300)

        if result.returncode == 0:
            log_message(f"Package {file_name} successfully deployed.", log_box, level="SUCCESS")
            return True
        else:
            error_output = result.stderr.decode('utf-8', errors='replace')
            log_message(f"Silent install failed for {file_name}.", log_box, level="WARNING")

            return False

    except subprocess.TimeoutExpired:
        log_message(f"Deployment timed out for {file_name} after 5 minutes", log_box, level="ERROR")
        return False
    except Exception as e:
        log_message(f"Critical error deploying {file_name}: {str(e)}", log_box, level="CRITICAL")
        return False
